  \"2013-03-14T15:11:35.049428\",\n\t\"name\": \"saline-county-ortho-2006-doqq-footprint-polygon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Orthophotos combine the image characteristics
  of a photograph with the geometric qualities of a map. This tile is provided as
  a digital ortho quarter-quarter-quadrangle (DOQQQ) 1-foot ground resolution, image
  cast on the State Plane South coordinate system on the North American Datum of 1983
  (NAD83). The geographic extent of the DOQQQ is equivalent to a quarter-quarter-quadrangle
  plus the over edge ranges from a minimum of 50 meters to a maximum of 300 meters
  beyond the extremes of the primary and secondary corner points. The over edge is
  included to facilitate tonal matching for mosaicing and for the placement of the
  NAD83 and secondary datum corner ticks. The normal orientation of data is by lines
  (rows) and samples (columns). Each line contains a series of pixels ordered from
  west to east with the order of the lines from north to south. This series of DOQQQs
  was produced as a part of the Arkansas Digital Orthophotography Program headed by
  the Arkansas State Land Information Board and the Arkansas Geographic Information
  Office. The aerial photography used to create the digital images was flown between
  December 29, 2005 and February 4, 2006\",\n\t\"license_title\": null,\n\t\"extras\":
